import React, { useState, useEffect } from "react"
import logo from './logo.svg';
import './App.css';

function App() {
  let [users, setUsers] = useState([])

  useEffect(() => {
    fetch("/api/users")
        .then((response) => response.json())
        .then((json) => setUsers(json))
  }, []);

  return (
      <ul>
        {users.map((user) => (
            <li key={user.id}>{user.name}</li>
        ))}
      </ul>
  )
}

export default App;
